class Solution(object):
    def smallestRange(self, nums):
        """
        :type nums: List[List[int]]
        :rtype: List[int]
        """
        def bsearch(array, target):
            start = 0
            end = len(array) - 1
            while start <= end:
                mid = (start+end)/2
                if array[mid] == target:
                    return mid
                elif array[mid] > target:
                    end = mid-1
                else:
                    start = mid + 1
            return start
        def Merge(nums):
            if len(nums) == 2:
                return mergetwolist_nodup(nums[0], nums[1])
            elif len(nums) == 1:
                return nums[0]
            mid = (len(nums)-1)/2
            num1 = Merge(nums[:mid])
            num2 = Merge(nums[mid:])
            return mergetwolist_nodup(num1, num2)
    
        def mergetwolist_nodup(num1, num2):
            pt_1, pt_2 = [0] *2
            num = []
            while pt_1 <len(num1) and pt_2 < len(num2):
                if num1[pt_1] == num2[pt_2]:
                    num.append(num1[pt_1])
                    pt_1 += 1
                    pt_2 += 1
                elif num1[pt_1] < num2[pt_2]:
                    num.append(num1[pt_1])
                    pt_1 += 1
                else:
                    num.append(num2[pt_2])
                    pt_2 += 1
            else:
                if pt_1 == len(num1):
                    num += num2[pt_2:]
                else:
                    num += num1[pt_1:]
                return num

        #Screen the simple case:
        lo_upper = min([max(each) for each in nums])
        lo_lower = min([each[0] for each in nums])
        hi_lower = max([min(each) for each in nums])
        hi_upper = max([each[-1] for each in nums])
        #if hi_lower >= lo_upper:
        #    return (lo_upper, hi_lower)
        #register numbers in nums:
        number_reg = {}
        for i in xrange(len(nums)):
            for number in nums[i]:
                if number not in number_reg:
                    number_reg[number] = set([i])
                else:
                    number_reg[number].add(i)
        merged_nums = Merge(nums)
        low_boundary = bsearch(merged_nums, lo_upper)
        high_boundary = bsearch(merged_nums, hi_lower)
        min_range = [lo_lower, hi_upper]
        for i in xrange(low_boundary+1):
            color_set = set(number_reg[merged_nums[i]])
            j = i
            while merged_nums[i] > merged_nums[j]:
                j += 1
            color_set |= set(number_reg[merged_nums[j]])
            while len(color_set) < len(nums) and j < len(merged_nums):
                j += 1
                color_set |= set(number_reg[merged_nums[j]])
            else:
                if min_range[1]-min_range[0] > merged_nums[j]- merged_nums[i]:
                    min_range = (merged_nums[i], merged_nums[j])
        return min_range
